import React from "react"
//import axios from 'axios'

class Contactlist extends React.Component{
    constructor(props){
        super(props)
        
    }
    
    render(){
        return(
            <div>
                {
                    this.state.results.map((item)=>(
                        <div>
                            <h2>{item.fname}</h2>
                            <p>{item.email}</p>
                            <p>{item.phone}</p>
                            //<button onClick={(e)=>this.deleteUser(e,item.id)}>delete</button>
                        </div>
                    ))
                }
            </div>
        )
    }
}

export default Contactlist
